[OPP-1103] legge til mulighet for overstyring om oppgave-tilordning feiler 298873b
Backend vil i fremtiden starte å returnere 409 Conflict om en oppgave allerede er tildelt en annen saksbehandler.
I disse tilfellene ønsker vi å gi saksbehandler informasjon om dette, samt gi de muligheten til å overstyre denne sperren.


[OPP-1103] legge til mulighet for bruken av js-popup-boxes med styling c601e99
Bruken av window.alert, window.confirm og window.prompt kan i mange tilfeller forenkle kode-flyten vesentlig.
Men disse har man dessverre ikke mulighet til å style, eller kontrollere på noen måte.
Funksjonene eksponert fra popup-boxes.tsx løser begge dette, og lar oss bruke små popup-bokser som en del av andre flyter.
F.eks
import { alert, confirm, prompt } from '...';

// Bruk i en komponent
const handler = async () => {
  if (await confirm('Er du sikker?')) {
    const identCaptcha = await prompt('Skriv inn din ident for å fortsette...');
    return post(url, data);
  } else {
    await alert('Innsending avbrutt');
  }
};

return (
  <button onClick={handler}>Send melding</button>
);

